import React from "react";
import { Swiper, SwiperSlide} from "swiper/react";
import { Pagination as SwiperPagination } from "swiper"; // Rename to avoid conflict

import Header from "../Header";
import Intro from "../Intro";
import Skill from "../Skill";
import Resume from "../Resume";
import Project from "../Project";
import Contact from "../Contact";
import Footer from "../Footer";

const Home = () => {
    return (
        <>
            <Header />
            <Swiper
        direction={"vertical"}
        Pagination={{
          clickable: true,
        }}
        modules={[Pagination]}
        className="mySwiper"
      >
                <SwiperSlide>
                    <Intro />
                </SwiperSlide>
                <SwiperSlide>
                    <Skill />
                </SwiperSlide>
                <SwiperSlide>
                    <Project />
                </SwiperSlide>
                <SwiperSlide>
                    <Resume />
                </SwiperSlide>
                <SwiperSlide>
                    <Contact />
                </SwiperSlide>
                </Swiper>
            <Footer />
        </>
    );
};

export default Home;
